import React from "react";
import NovelCard from "./NovelCard";


function BookList({books, updateNovel, handelRemoveNovel}){
    const booksList = (
        <div id="book-collection">{
            books.map((book)=>{
             return <NovelCard key={book.id} book={book} updateNovel={updateNovel} handelRemoveNovel={handelRemoveNovel}/>
            })
          }</div>
      )


    return(
        <div>
            <h1>Novels</h1>
            {booksList}
        </div>
    )
}

export default NovelList
